import React from 'react'

const Category_product = ({title}) => {
  return (
    <article>
        <div className='category-product-title'>
            {title}
        </div>

        <figure>
            <div className='category-product-image-container'>
            </div>
        </figure>
    </article>
  )
}

export default Category_product
